import Link from 'next/link'
class hello extends React.Component{
    render(){
        return(
            <div>
                <Link href="/"><a>Home</a></Link>
                <Link href="/about"><a>about</a></Link>
                <h1>I am Home page</h1>
            </div>
        );
    }
}
export default hello;
